public void initFromLedgerJournalTrans(LedgerJournalTrans           _ledgerJournalTrans,
                                       LedgerJournalTrans_RCash     _ledgerJournalTrans_RCash)
{
    DimensionDefault offsetDefaultDimension;

    this.initFromLedgerJournalTransSafe(_ledgerJournalTrans, _ledgerJournalTrans_RCash);
    this.AmountMST = _ledgerJournalTrans.calcAmountMST();

    if (_ledgerJournalTrans.OffsetAccountType != LedgerJournalACType::RCash)
    {
        this.OffsetLedgerDimensionNum = _ledgerJournalTrans.OffsetLedgerDimension;
        offsetDefaultDimension        = _ledgerJournalTrans.OffsetDefaultDimension;
        this.OffsetAccountType        = _ledgerJournalTrans.OffsetAccountType;

        changecompany (_ledgerJournalTrans.OffsetCompany ? _ledgerJournalTrans.OffsetCompany : curext())
        {
            this.OffsetLedgerDimension = LedgerDimensionFacade::serviceCreateLedgerDimension(RCashTransType::offsetLedgerDimension(_ledgerJournalTrans), offsetDefaultDimension);
        }
    }
    else
    {
        this.OffsetLedgerDimensionNum = _ledgerJournalTrans.orig().LedgerDimension;
        offsetDefaultDimension        = _ledgerJournalTrans.orig().DefaultDimension;
        this.OffsetAccountType        = _ledgerJournalTrans.orig().AccountType;
        changecompany (_ledgerJournalTrans.OffsetCompany ? _ledgerJournalTrans.OffsetCompany : curext())
        {
            this.OffsetLedgerDimension = LedgerDimensionFacade::serviceCreateLedgerDimension(RCashTransType::offsetLedgerDimension(_ledgerJournalTrans), offsetDefaultDimension);
        }
    }
}

public void initFromLedgerJournalTransSafe(LedgerJournalTrans       _ledgerJournalTrans,
                                           LedgerJournalTrans_RCash _ledgerJournalTrans_RCash)
{
    this.DocId                  = _ledgerJournalTrans_RCash.CashDocId;
    this.DocType                = _ledgerJournalTrans_RCash.DocType;
    this.TransDate              = _ledgerJournalTrans.TransDate;
    this.AttachmentNum          = _ledgerJournalTrans.DocumentNum;
    this.AttachementDate        = _ledgerJournalTrans.DocumentDate;
    this.PaymentNotes           = _ledgerJournalTrans.BankCentralBankPurposeText;
    this.AccountNum             = _ledgerJournalTrans.parmAccount();
    this.Voucher                = _ledgerJournalTrans.Voucher;
    this.Txt                    = _ledgerJournalTrans.Txt;
    this.CurrencyCode           = _ledgerJournalTrans.CurrencyCode;
    this.AmountCur              = _ledgerJournalTrans.amount();
    this.OffsessionId           = _ledgerJournalTrans.OffSessionId_RU;
    this.DocRepresPersonId      = _ledgerJournalTrans.rCashDocRepresPersonId;
    this.DocRepresType          = _ledgerJournalTrans.rCashDocRepresType;
    this.ReasonRefRecID         = ReasonTableRef::checkCreateInCompany(_ledgerJournalTrans.ReasonRefRecID, this.DataAreaId);
    // <GEELV>
    this.LvCashReceiptTable     = _ledgerJournalTrans_RCash.LvCashReceiptTable;
    this.CashReceiptNumLV       = _ledgerJournalTrans_RCash.CashReceiptNumLV;
    // </GEELV>
    // <GEEPL>
    this.TransRegDate_PL        = _ledgerJournalTrans_RCash.TransRegDate_PL;
    // </GEEPL>
    this.CashPayTransType       = _ledgerJournalTrans.RCashPayTransType;
    // <GEERU>
    this.RepresPersonName_W     = _ledgerJournalTrans.RepresPersonName_W;
    this.RepresPersonCard_W     = _ledgerJournalTrans.RepresPersonCard_W;
    // </GEERU>
}

/// <summary>
/// Inserts a record into the <c>RCashTrans</c> table.
/// </summary>
public void insert()
{
    #ISOCountryRegionCodes
    CurrencyExchangeHelper currencyExchangeHelper;
    LedgerJournalTrans     ledgerJournalTrans;

    if (Ledger::reportingCurrency()
        && this.AmountCur               != 0
        && this.ReportingCurrencyAmount == 0)
    {
        ledgerJournalTrans = LedgerJournalTrans::findJournalForVoucher(this.Voucher,this.TransDate);
        currencyExchangeHelper = CurrencyExchangeHelper::newExchangeDate(Ledger::current(), this.TransDate);

        currencyExchangeHelper.parmExchangeRate1(ledgerJournalTrans.ExchRate);
        currencyExchangeHelper.parmExchangeRate2(ledgerJournalTrans.ExchRateSecond);
        currencyExchangeHelper.parmReportingExchangeRate1(ledgerJournalTrans.ReportingCurrencyExchRate);
        currencyExchangeHelper.parmReportingExchangeRate2(ledgerJournalTrans.ReportingCurrencyExchRateSecondary);

        this.ReportingCurrencyAmount = currencyExchangeHelper.calculateTransactionCurrencyToReportingCurrency(
            this.CurrencyCode, this.AmountCur);
    }

    super();

    str featureReference = GlobalizationInstrumentationHelper::getFeatureRefByLegalEntityCountryRegion([
        [#isoPL, GlobalizationConstants::FeatureReferencePL00021],
        [#isoCZ, GlobalizationConstants::FeatureReferenceCZ00016],
        [#isoHU, GlobalizationConstants::FeatureReferenceHU00016],
        [#isoLT, GlobalizationConstants::FeatureReferenceLT00017],
        [#isoLV, GlobalizationConstants::FeatureReferenceLV00012],
        [#isoEE, GlobalizationConstants::FeatureReferenceEE00013]
    ]);
    if (featureReference)
    {
        GlobalizationInstrumentationHelper::featureRun(featureReference, funcName());
    }
}

public LedgerJournalTrans ledgerJournalTrans()
{
    LedgerJournalTrans               journalTrans;
    LedgerJournalTrans_RCash         journalTrans_RCash;
    DimensionAttributeLevelValueView dimAttrLevelValueView;

    select firstonly journalTrans
        where journalTrans.AccountType  == LedgerJournalACType::RCash &&
              journalTrans.TransDate    == this.TransDate
    exists join dimAttrLevelValueView
        where dimAttrLevelValueView.ValueCombinationRecId == journalTrans.LedgerDimension
           && dimAttrLevelValueView.DisplayValue          == this.AccountNum
    join TableId from journalTrans_RCash
        where journalTrans_RCash.RefRecId  == journalTrans.RecId &&
              journalTrans_RCash.DocType   == this.DocType       &&
              journalTrans_RCash.CashDocId == this.DocId;
    return journalTrans;
}

/// <summary>
///    Returns the offset account number of the cash transaction.
/// </summary>
/// <returns>
///    The offset account number of the cash transaction.
/// </returns>
public AccountNum offsetAccountNum()
{
    DimensionAttributeValueCombination  ledgerDimension;
    AccountNum                          account;

    if (this.OffsetLedgerDimensionNum)
    {
        if (this.OffsetAccountType == LedgerJournalACType::Ledger)
        {
            account = LedgerDimensionFacade::getMainAccountFromLedgerDimension(this.OffsetLedgerDimensionNum).MainAccountId;
        }
        else
        {
            select DisplayValue from ledgerDimension where ledgerDimension.RecId == this.OffsetLedgerDimensionNum;
            account = ledgerDimension.DisplayValue;
        }
    }

    return account;
}

public RCashTransType type()
{
    return new RCashTransType(this);
}

/// <summary>
/// Calculates related posting vouchers and dates.
/// </summary>
/// <returns>
/// Container with related posting vouchers and dates.
/// </returns>
public container voucherTransDateValue()
{
    RCashTrans cashTrans;
    str        voucherValue, transDateValue;

    while select Voucher, TransDate from cashTrans
        where cashTrans.RefRecId &&
              cashTrans.RefRecId == this.RefRecId
    {
        voucherValue   = queryRangeConcat(voucherValue, cashTrans.Voucher);
        transDateValue = queryRangeConcat(transDateValue, cashTrans.TransDate);
    }

    if (! voucherValue && ! transDateValue)
    {
        voucherValue   = this.Voucher;
        transDateValue = queryValue(this.TransDate);
    }

    return [ voucherValue, transDateValue ];
}

public static boolean exist(RCashAccount    _account,
                            RCashDocId      _docId,
                            RCashDocType    _docType,
                            TransDate       _transDate)
{
    return _account && _docId &&
           (select firstonly RecId from rCashTrans
                where rCashTrans.AccountNum == _account &&
                      rCashTrans.DocId      == _docId   &&
                      rCashTrans.DocType    == _docType &&
                      rCashTrans.TransDate  == _transDate).RecId;
}

public static RCashTrans find(RCashAccount    _account,
                              RCashDocId      _docId,
                              RCashDocType    _docType,
                              TransDate       _transDate,
                              boolean         _update = false)
{
    RCashTrans rCashTrans;

    rCashTrans.selectForUpdate(_update);

    select firstonly rCashTrans
        index AccDocTypeIdx
        where rCashTrans.AccountNum == _account     &&
              rCashTrans.DocId      == _docId       &&
              rCashTrans.DocType    == _docType     &&
              rCashTrans.TransDate  == _transDate;

    return rCashTrans;
}

public static RCashTrans findLedgerJournalTrans(LedgerJournalTrans _ledgerJournalTrans,
                                                boolean            _update = false)
{
    LedgerJournalTrans_RCash ledgerJournalTrans_RCash = LedgerJournalTrans_RCash::find(_ledgerJournalTrans.RecId);

    return RCashTrans::find(_ledgerJournalTrans.parmAccount(),
                            ledgerJournalTrans_RCash.CashDocId,
                            ledgerJournalTrans_RCash.DocType,
                            _ledgerJournalTrans.TransDate,
                            _update);
}

public static RCashTrans findRecId(RecId       _recId,
                                   boolean     _update = false)
{
    RCashTrans rCashTrans;

    rCashTrans.selectForUpdate(_update);

    select firstonly rCashTrans where rCashTrans.RecId == _recId;

    return rCashTrans;
}

public static RCashTrans findVoucher(RCashAccount  _account,
                                     Voucher       _voucher,
                                     TransDate     _transDate,
                                     boolean       _update = false)
{
    RCashTrans rCashTrans;

    rCashTrans.selectForUpdate(_update);

    select firstonly rCashTrans
        where   rCashTrans.AccountNum == _account   &&
                rCashTrans.Voucher    == _voucher   &&
                rCashTrans.TransDate  == _transDate;

    return rCashTrans;
}

/// <summary>
/// Indicates whether there is any cash transaction with exchange rate on specified date.
/// </summary>
/// <param name="_rCashAccount">
/// The cash account to check.
/// </param>
/// <param name="_currencyCode">
/// The currency code to check.
/// </param>
/// <param name="_transDate">
/// The date to check.
/// </param>
/// <returns>
/// true if there is a cash transaction with exchange rate on specified date; otherwise, false.
/// </returns>
public static boolean hasExchRateOnDate(AccountNum   _rCashAccount,
                                               CurrencyCode _currencyCode,
                                               TransDate    _transDate)
{
    return _rCashAccount &&
           _currencyCode &&
           _transDate    &&
           (select firstonly RecId from rCashTrans
                where rCashTrans.AccountNum   == _rCashAccount &&
                      rCashTrans.CurrencyCode == _currencyCode &&
                      rCashTrans.TransDate    == _transDate    &&
                      rCashTrans.DocType      == RCashDocType::ExchRateDifference).RecId;
}

public void modifiedField(FieldId _fieldId)
{
    super(_fieldId);
    if (_fieldId == fieldNum(RCashTrans, DocType))
    {
        this.IsCorrection = (this.DocType == RCashDocType::Correction);
    }
}
